// import Vue from 'vue';
import { createRouter, createWebHashHistory } from "vue-router";
import Home from '../views/Home.vue'
import Login from '../views/Login.vue'


let routes = [         
    {             
        path:'/home',             
        component: Home         
    },        
    {             
        path:'/login',             
        component: Login         
    }
]

var router = new createRouter({     // 配置路由   
    mode:createWebHashHistory(),  
    routes,
}) 

export default router
